import React from "react";
import "./About.css";

const About = () => {
    return (
        <div className="about-banner">
            <div className="about-content">
                <h1>ABOUT US</h1>
                <p>Traveling fosters a medium to build human connections with one another by learning about culture, food, new sites, music, and the way people live their day to day lives in different parts of the world. It's the best on-site learning a person can get.Traveling is also important for human happiness and mental health.</p>
            </div>
        </div>
    );
};

export default About;
